import React from 'react';
import {Card} from 'react-bootstrap';
import {Button} from 'react-bootstrap';
import Logo from './logo.PNG';
// Om oss, component i Landing.js, skal fortelle litt om oss, skal deretter følge en knapp for registrering med google

const OmApp = () => {
    return(
      <Row >
      <div className="text-white text-center">
          <img className="rounded-circle pt-5" src={Logo} alt="" />
          <h1 className="text-uppercase mt-3">See what's next </h1>
          <p>APP2000 prosjekt</p>
      </div>  
      </Row>
    );
};
export default OmApp;
